<?phpnamespace Nemundo\Web\Parameter;use Nemundo\Core\Type\DateTime\Date;abstract class AbstractDateUrlParameter extends AbstractUrlParameter{    /*public function getDate() {        return (new Date())->fromGermanFormat($this->getValue());    }*/    public function getDate()    {        $date = new Date();        if (parent::hasValue()) {            $date = (new Date())->fromGermanFormat($this->getValue());        }        return $date;    }    public function hasValue()    {        return $this->getDate()->hasValue();    }}